import React from 'react';

import styles from './Header.css'

// 位

class Header extends React.Component {
	render() {
		return (
			<div className="header-area">
				<h1>The <span className="sf">位</span> Interpreter</h1>

				<div className="header-desc">A Functional Programming Language 
					Interpreter written in Python. 
					The fundamental idea of this language is to express the functional 
					nature of the language, as every function is
					a <span className="sf">位</span> expression bound to an identifier.</div>

				<button className="btn button run" onClick={this.props.execute}>
					<img src="./assets/caret-right-fill.svg" width="16" height="16"
						fill="#fff;"></img>Execute
				</button>
				<button className="btn button res" onClick={this.props.reset}>
					Reset
				</button>
			</div>
			);
	}
}

export default Header;
